ub below!), fresh coriander\\/cilantro, then par boiled lightly spiced rice.<\\/p><p style=\\\"box-sizing: inherit; padding: 0px; margin-top: 16px; margin-bottom: 16px; color: rgb(61, 61, 61); font-family: Raleway, sans-serif; font-size: 18px; white-space: normal;\\\">The crowning glory is to finish it off with a drizzle of saffron infused water to give it the signature patches of bright yellow rice, as well as ghee (or melted butter) for buttery richness.<\\/p><p style=\\\"box-sizing: inherit; padding: 0px; margin-top: 16px; margin-bottom: 16px; color: rgb(61, 61, 61); font-family: Raleway, sans-serif; font-size: 18px; white-space: normal;\\\">The pot is then covered and cooked over a low heat for about 25 minutes during which time the rice absorbs the aromas and flavours of the curry underneath, whilst still being beautifully fluffy.<\\/p><p><br\\/><\\/p>\",\"_token\":\"DSevs3ByBGwx5oOQgMnKjFvBh0zg3CuqAdi32Lbn\",\"_previous_\":\"https:\\/\\/shop.dbestech.com\\/admin\\/places\"}','2021-12-26 22:27:38','2021-12-26 22:27:38'),(300,1,'admin/places','GET','58.39.14.207','[]','2021-12-26 22:27:38','2021-12-26 22:27:38'),(301,1,'admin/places/create','GET','58.39.14.207','{\"_pjax\":\"#pjax-container\"}','2021-12-26 22:28:12','2021-12-26 22:28:12'),(302,1,'admin/places','POST','58.39.14.207','{\"name\":\"Chicken biriani\",\"price\":\"12\",\"location\":\"china\",\"stars\":\"4\",\"people\":\"3\",\"selected_people\":\"3\",\"description\":\"<p><span style=\\\"color: rgb(17, 17, 17); font-family: -apple-system, &quot;system-ui&quot;, &quot;Segoe UI&quot;, Roboto, Oxygen-Sans, Ubuntu, Cantarell, &quot;Fira Sans&quot;, &quot;Droid Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, &quot;\\u30d2\\u30e9\\u30ae\\u30ce\\u89d2\\u30b4 Pro W3&quot;, &quot;Hiragino Kaku Gothic Pro&quot;, \\u30e1\\u30a4\\u30ea\\u30aa, Meiryo, &quot;\\uff2d\\uff33 \\uff30\\u30b4\\u30b7\\u30c3\\u30af&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&