INSERT INTO `foods` VALUES (1,'Bnh Tm','<p>Bnh Tm H Ty l mt mn n c sn ni ting ca H Ni, c bit gn lin vi khu vc H Ty. Mn n ny c lm t nhng con tm ti ngon, thng l tm h, bc trong lp bt m v bt go, sau  chin gin. Lp v bnh gin rm bn ngoi, bn trong l tht tm ngt t nhin, to nn mt s kt hp hon ho v hng v v kt cu.</p>',40000,5,5,5,'images/d5247f30b4e4867c3289c17574689868.JPG','VietNam','2021-11-17 02:09:08','2024-07-19 02:57:29',2),(3,'Bnh Cm','<p style=\"border: 0px; margin-top: 0px; margin-bottom: 1.3em; padding: 0px; line-height: 1.8; color: rgb(58, 58, 58); font-family: Montserrat, sans-serif; font-size: 20px; white-space: normal; background-color: rgb(255, 255, 255);\">Bnh Cm lm t go np non, c ch bin thnh nhng chic bnh nh c mu xanh p mt. Go np c xay nhuyn, trn vi da v u xanh, ri gi trong l sen hoc l dong  to hnh. Bnh c hng v thm ngt ca da v u xanh, cng vi s do mn ca go np. Bnh cm thng c dng lm mn qu biu hoc n nh, mang m hng v v nt vn ha ca m thc H Ni.</p><p><br/></p>',20000,5,5,4,'images/815c5c16e4b1dfa9c617789f159a6f4c.JPG','VietNam','2021-11-17 02:16:31','2024-07-19 03:05:12',3),(4,'Kem B Da','<p>Kem b da l mt mn trng ming ngon v ph bin, c lm t b v da. Kem c v bo ngy t b, cng vi hng v da ti mt. Thng c lm t sa c, ng v da ti bo nh, v c th c n ngay hoc lm nguyn liu cho cc mn trng ming khc nh kem b da lnh.</p>',20000,5,5,3,'images/37fa58311e273af5e81eb714995eb670.JPG','VietNam','2021-11-17 02:18:46','2024-07-03 03:26:49',3),(5,'Cafe Trng','<p>C Ph Trng&nbsp;ni bt vi s kt hp gia c ph v trng. Mn ny c ch bin bng cch nh bng lng  trng vi ng v sa c, sau  cho ln trn ly c ph en nng. Lp kem trng mn mng, ngt ngo v bng xp to ra s tng phn th v vi v ng ca c ph, mang n mt hng v c bit v tri nghim thng thc mi l. C ph trng khng ch l mt mn  ung, m cn l mt phn ca vn ha m thc H Ni.</p>',25000,5,5,4,'images/ee022e9c2b063018c248e9c6fc9e7081.JPG','VietNam','2021-12-08 04:29:53','2024-07-19 03:09:27',3),(6,'Xi Xo','<p>Xi Xo l mt mn n c sn ni ting ca H Ni, Vit Nam. Mn xi ny ni bt vi mu vng m t ngh, c lm t go np do, c hp chn mm v c hng v thm ngon. Xi xo thng c n km vi u xanh xay nhuyn, hnh phi gin, v c th thm cht ruc hoc tht heo bm nh  tng thm hng v. Mn n ny thng c dng lm ba sng hoc n nh trong ngy, ni bt vi s kt hp hi ha gia v ngt ca u xanh, v bo ca hnh phi v v do ca xi, to nn mt tri nghim m thc m  v d chu.</p>',15000,5,3,3,'images/30264816661ccde4f2b4915f81413e3b.JPG','VietNam','2021-12-23 07:03:24','2024-07-19 02:55:07',2),(7,'Bn Thang','<p>Bn Thang l mt mn n truyn thng c trng ca H Ni, ni ting vi hng v tinh t v s kt hp hi ha ca nhiu nguyn liu. Mn bn ny gm c bn ti, tht g x, trng g chin mng thi si, gi la thi ch, v tm kh. Tt c c by tr p mt trong bt, ri chan nc dng nng hi c ninh t xng g v tm, to nn hng v ngt thanh, thm ngon. Mn n c n km vi mm tm, cht gim, v rau sng nh hnh l, rau rm, lm tng thm s hp dn v m .</p>',50000,5,0,0,'images/aa32e0fba3386d8131b8402016507882.JPG','VietNam','2021-12-23 07:04:49','2024-07-19 02:54:18',2),(8,'Tht Kho Trng','<p>Tht kho trng c&nbsp;nu t tht heo v trng g cng vi gia v nh nc mm, ng v ti. Mn n ny c v ngt m, thng c n cng cm trng.</p>',40000,4,3,2,'images/7c96b46e53d5bb272815518176d736bc.JPG','VietNam','2021-12-25 17:36:29','2024-07-03 03:25:58',3),(9,'Bnh Cun','<p>Bnh cun Thanh Tr l mt mn n truyn thng ni ting ca vng Thanh Tr, H Ni. Bnh cun c lm t bt go t mn, c trng mng v hp chn trn ni hp chuyn dng. Bnh cun Thanh Tr thng khng c nhn, n km vi hnh phi gin rm, ch qu hoc ch la, v nc mm pha chua ngt.</p>',30000,5,3,3,'images/de82e3d1f519c034040b52e484e07c50.JPG','VietNam','2021-12-26 22:27:38','2024-07-19 02:53:22',3),(10,'Ph Cun','<p>Ph cun&nbsp;l mt mn n c trng ca H Ni, Vit Nam, vi s kt hp c o gia bnh ph ti v cc nguyn liu ti ngon. Bnh ph c ct thnh ming vung va phi, cun cng vi tht b thi mng, xo chn v cc loi rau sng nh x lch, rau thm. Mn n c n km vi nc chm chua ngt, to nn hng v thanh mt, d n, ph hp cho nhng ngy h nng bc.</p>',50000,5,3,3,'images/336f6a7e157c31dd80be884ab8195ce5.JPG','VietNam','2021-12-26 22:29:47','2024-07-19 02:51:58',2),(11,'Bnh M','<p>Mt  bnh m sng gin, c nng sn v kp y  vi cc thnh phn nh tht nng (thng l tht heo nng), ch la (mt loi gi la xay mn), pate (mt loi st tht)</p>',20000,5,3,3,'images/f97c4f8a635a0e680747881aa3e2c327.webp','VietNam','2021-12-26 22:35:34','2024-10-28 21:01:30',2),(16,'Ph B','<p>Ph b l mt mn n ni ting ca Vit Nam, c bit n vi hng v m  v ngon ming. Mn ny gm mt t nc dng snh mn, nu t xng b v cc gia v nh hnh, gng, v cc loi gia v khc nh ht tiu v inh hng. Nc dng ny c rt ln lp bn ph mm, cng vi tht b thi mng. N thng c n km vi rau thm, gi v t ti, v c th c gia gim vi nc chanh v tng t theo khu v.</p>',40000,5,3,3,'images/89a5714d8ed976872415e787f3c0a898.JPG','VietNam','2024-06-19 20:52:34','2024-06-30 17:55:30',2),(17,'Ch C L Vng','<p>Ch C L Vng l mn n c sn H Ni, gm c lng hoc c qu tm p ngh, th l v gia v, ri chin hoc nng. Mn n c phc v cng vi bn ti, hnh phi, th l, rau sng v da chua, thng n km vi nc mm chua ngt. y l mt mn n ni bt vi hng v m  v cch ch bin truyn thng tinh t.</p>',100000,5,18,1,'images/95126cb864ea3700a71f5f3c1134bffc.JPG','VietNam','2024-07-19 02:58:28','2024-07-19 03:08:27',3),(18,'Bn Riu','<p>Bn Riu&nbsp;bao gm bn ti, nc dng c ninh t xng heo hoc cua, v riu cua (tht cua c nh bng v nu cng nc dng). Bn riu thng c n km vi cc loi rau sng nh rau thm, gi , v da chua. Nc dng c v chua nh t c chua v riu cua, to nn mt mn n va m , va thanh mt.</p>',40000,5,18,3,'images/e4174498a2129964b2f3b2767f597770.JPG','VietNam','2024-07-19 03:00:02','2024-07-19 03:00:02',3),(19,'Bnh M Cho','<p>Bnh M Cho l mt mn n ph bin trong m thc Vit Nam, c bit l  min Nam. Mn n ny bao gm bnh m nng, gin, c n km vi cc mn xo trong cho nh tht b, xc xch, trng p la, hnh ty, v i khi cn c thm nm hoc rau c. Cc nguyn liu c ch bin trong mt chic cho nh, to ra mt ba n y n v hp dn. Bnh m cho thng c n km vi nc st m  v cc loi gia v nh t, tiu, v hnh l, mang n mt s kt hp hi ha gia v gin ca bnh m v hng v phong ph ca cc thnh phn khc.</p>',35000,5,18,1,'images/be6780d2688fa809ef826fa132b75d06.JPG','VietNam','2024-07-19 03:01:32','2024-07-19 03:10:34',3),(20,'Nem Rn','<p>Nem Rn&nbsp;gm cc nguyn liu nh tht heo xay, tm, nm, min, v rau c, tt c c trn u ri gi vo lp bnh trng. Sau , nem c chin gin cho n khi c lp v ngoi vng rum v gin rm. Nem rn thng c n km vi rau sng, da leo, v nc mm chua ngt hoc nc mm pha gia v. Mn n mang n hng v m , gin rm v hp dn, thng c thng thc trong cc ba n chnh hoc trong cc dp l hi.</p><p><br/></p>',50000,5,18,3,'images/2f12a611fcf9e37de70d01b029973ecb.JPG','VietNam','2024-07-19 03:02:37','2024-07-19 03:07:05',3),(21,'Bn u Mm Tm','<p>Bn u mm tm l mt mn n ng ph c trng ca H Ni, Vit Nam, ni ting vi hng v c o v s kt hp a dng ca cc thnh phn. Mn n ny gm bn l, u h chin gin, v cc loi ch nh ch cm, ch la, hoc tht ln luc. Tt c c by trn mt mt tre lt l chui, n km vi rau sng nh ta t, kinh gii, v da leo.</p>',50000,5,3,4,'images/3ac33c5462ba2505035708e369704eca.JPG','VietNam','2024-07-19 03:03:24','2024-07-19 03:05:55',3);
